import React from 'react' 

const style = {
    section: {
        backgroundColor: "rgba(255, 255, 128, .5)",
        borderRadius: "20px",
        color: "#000"
    }
}

export default function MyHeroes() {
    return(
        <div style={style.section}>
            <h2>IU and Saffro are going to sing. With them are:</h2>
            <ol>
                <li>Beatriche</li>
                <li>Carolina</li>
                <li>Juliana</li>
            </ol>
        </div>
    )
}
